  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset has monthly Sea Surface Temperature
  (SST) data from thenTAO/TRITON (Pacific Ocean, http://www.pmel.noaa.gov/tao/),nRAMA
  (Indian Ocean, http://www.pmel.noaa.gov/tao/rama/), andnPIRATA (Atlantic Ocean,
  http://www.pmel.noaa.gov/pirata/)narrays of moored buoys which transmit oceanographic
  and meteorological data to shore in real-time via the Argos satellite system.  These
  buoys are major components of the CLIVAR climate analysis project and the GOOS,
  GCOS, and GEOSS observing systems.  Monthly data is an average of daily values collected
  during a month.  A minimum of 15 daily values are required to compute a monthly
  average.  This dataset contains realtime and delayed mode data (see the 'source'
  variable).  For more information, seenhttp://www.pmel.noaa.gov/tao/proj_over/proj_over.html
  .\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
